    /* SEO SETTINGS */
    CategoryComponent.prototype.setSeo = function () {
        var _this = this;
        this.http.get(this.seourl).subscribe(function (res) {
            _this.seometa = res.data[0];
            //this.getcate(this.seometa.id);
            if (_this.seometa.meta.title) {
                _this.title.setTitle(_this.seometa.meta.title);
                _this.meta.updateTag({
                    name: "twitter:title",
                    content: _this.seometa.meta.title
                });
                _this.meta.updateTag({
                    name: "og:title",
                    content: _this.seometa.meta.title
                });
            }
            _this.meta.addTag({
                property: "og:url",
                content: _this.seopath + "" + _this.router.url
            });
            if (_this.seometa.meta.description) {
                _this.meta.updateTag({
                    name: "description",
                    content: _this.seometa.meta.description
                });
                _this.meta.addTag({
                    property: "og:description",
                    content: _this.seometa.meta.description
                });
                _this.meta.updateTag({
                    name: "twitter:description",
                    content: _this.seometa.meta.description
                });
            }
            if (_this.seometa.meta.keywords) {
                _this.meta.updateTag({
                    name: "keywords",
                    content: _this.seometa.meta.keywords
                });
            }
        }, function (msg) {
            //console.log(msg);
        });
        var link = this.doc.createElement("link");
        link.setAttribute("rel", "canonical");
        this.doc.head.appendChild(link);
        link.setAttribute("href", this.seopath + "/listing-category/" + this.cateSlug);
    };
