    CategoryComponent.prototype.truncateHTML = function (text) {
        var charlimit = 220;
        if (!text || text.length <= charlimit) {
            return text;
        }
        var without_html = text.replace(/<(?:.|\n)*?>/gm, "");
        var shortened = without_html.substring(0, charlimit);
        return shortened + "...";
    };
